import React from 'react';
import axios from 'axios';
import { useState, useEffect } from 'react';

const Bugs = () => {

    const [bugs, setBugs] = useState("");

    useEffect(() => {
        axios.get(`https://acnhapi.com/v1/bugs/`)
            .then(response => {
                console.log(response.data.id);
                setBugs(response.data)
            })
            .catch(error => {
                console.log(error)
            })
    }, []);


    return (
        <div>

        </div>)
};

export default Bugs;
